import React from "react";
import "./nav.scss";
import logo from '../../images/logo_umatech.svg';

const Nav = ({ list}) => {
    function liClick(e) {
        e.preventDefault();
        var activeLi;
    }
    return (
    <nav className="menu">
        <div class="container">
          <div class="nav__wrap">
            <div class="nav__left"><img src={logo} alt="Uma.Tech"/></div>
            <div class="nav__right">
              <ul class="nav__list">
              {list.map((li, index) => (
                    <li
                        key={index}
                        data-index={index + 2}
                        className={`menu-ul__li menu-ul__li-${li.src}`}
                        onClick={liClick}
                    >
                        <a href={`#${li.src}`}>
                           {li.title}
                        </a>
                    </li>
                ))}
              </ul>
            </div>
          </div>
        </div>
      </nav>
    );
};

export default Nav;
